import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
function App() {
  return <main>
    <GeRandomColor>Hello word</GeRandomColor>
  </main>;
}
function GeRandomColor(props){
  var randomColor = '#'+Math.floor(Math.random()*16777215).toString(16);
  return <h1 style={{color: randomColor}} >{props.children}</h1>;
}
